import Modal, { ModalTransition } from '@atlaskit/modal-dialog'; // Atlaskit Modal
import styles from 'styles/components/Modal.module.css'; // Component styles
import Button from '@atlaskit/button';

export default function DancefestModal({
  children,
  heading = 'heading',
  open = true,
  cancelText = 'Cancel',
  submitText = 'Submit',
}) {
  const footer = props => {
    return (
      <>
        <Button css={styles.modal__footer_cancel - button}>{cancelText}</Button>
        <Button css={styles.modal__footer_submit - button}>{submitText}</Button>
      </>
    );
  };

  return (
    <ModalTransition>
      {open && (
        <Modal
          actions={[
            {
              text: cancelText,
              className: `${styles.modal__footer}`,
            },
            { text: submitText, className: `${styles.modal__footer}` },
          ]}
          heading={heading}
        >
          <Button className={styles.modal__footer}>hello</Button>
          Modal
        </Modal>
      )}
    </ModalTransition>
  );
}
